import React from 'react';
import { BrowserRouter } from 'react-router-dom';
import Navbar from './component/navBar/navbar';
import ProductList from './component/product/productList';

const App: React.FC = () => {
  return (
    <BrowserRouter>
      <div className="App">
        <Navbar />
        <ProductList />
      </div>
    </BrowserRouter>
  );
}

export default App;
